INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (102301, "2020/07/31 12:00:00", 24, 401, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "2030/12/17 14:59:59", 10046, 2, "アヤネ", 0.0, 24001, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (102301, "2020/07/31 12:00:00", 24, 402, 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, "2030/12/17 14:59:59", 10046, 1, "アヤネ", 0.0, 24002, 2.21);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (102301, "2020/07/31 12:00:00", 24, 403, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "2030/12/17 14:59:59", 10046, 2, "アヤネ", 0.0, 24003, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192201, "2020/07/31 12:00:00", 24, 701, 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, "2030/12/17 14:59:59", 10046, 2, "アサヒ", 0.0, 24004, 1.99);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192201, "2020/07/31 12:00:00", 24, 702, 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, "2030/12/17 14:59:59", 10046, 1, "アサヒ", 0.0, 24005, 2.21);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192201, "2020/07/31 12:00:00", 24, 703, 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, "2030/12/17 14:59:59", 10046, 2, "アサヒ", 0.0, 24006, 3.33);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192301, "2020/07/31 12:00:00", 24, 801, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "2030/12/17 14:59:59", 10046, 2, "部員３", 0.0, 24007, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192301, "2020/07/31 12:00:00", 24, 802, 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, "2030/12/17 14:59:59", 10046, 1, "部員３", 0.0, 24008, 2.68);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192301, "2020/07/31 12:00:00", 24, 803, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "2030/12/17 14:59:59", 10046, 2, "部員３", 0.0, 24009, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192501, "2020/07/31 12:00:00", 24, 501, 1, "やった！", 0.0, "2030/12/17 14:59:59", 10046, 1, "", 0.0, 24010, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192501, "2020/07/31 12:00:00", 24, 502, 1, "勝ったよ！", 0.0, "2030/12/17 14:59:59", 10046, 1, "", 0.0, 24011, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192501, "2020/07/31 12:00:00", 24, 503, 1, "いい調子！", 0.0, "2030/12/17 14:59:59", 10046, 1, "", 0.0, 24012, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 111, 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, "2030/12/17 14:59:59", 10046, 6, "ミサト", 0.0, 24013, 5.33);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 112, 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, "2030/12/17 14:59:59", 10046, 1, "ミサト", 0.0, 24014, 6.85);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 113, 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, "2030/12/17 14:59:59", 10046, 1, "ミサト", 0.0, 24015, 3.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192401, "2020/07/31 12:00:00", 24, 611, 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, "2030/12/17 14:59:59", 10046, 1, "ダイチ", 0.0, 24016, 6.11);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192401, "2020/07/31 12:00:00", 24, 612, 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, "2030/12/17 14:59:59", 10046, 1, "ダイチ", 0.0, 24017, 6.75);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192401, "2020/07/31 12:00:00", 24, 613, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "2030/12/17 14:59:59", 10046, 2, "ダイチ", 0.0, 24018, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113401, "2020/07/31 12:00:00", 24, 211, 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, "2030/12/17 14:59:59", 10046, 2, "ハツネ", 0.0, 24019, 4.52);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113401, "2020/07/31 12:00:00", 24, 212, 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, "2030/12/17 14:59:59", 10046, 2, "ハツネ", 0.0, 24020, 3.89);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113401, "2020/07/31 12:00:00", 24, 213, 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, "2030/12/17 14:59:59", 10046, 1, "ハツネ", 0.0, 24021, 13.49);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (106501, "2020/07/31 12:00:00", 24, 311, 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, "2030/12/17 14:59:59", 10046, 1, "カヤ", 0.0, 24022, 3.17);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (106501, "2020/07/31 12:00:00", 24, 312, 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, "2030/12/17 14:59:59", 10046, 1, "カヤ", 0.0, 24023, 4.42);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (106501, "2020/07/31 12:00:00", 24, 313, 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, "2030/12/17 14:59:59", 10046, 6, "カヤ", 0.0, 24024, 2.89);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (102301, "2020/07/31 12:00:00", 24, 421, 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, "2030/12/17 14:59:59", 10046, 4, "アヤネ", 0.0, 24025, 3.71);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192201, "2020/07/31 12:00:00", 24, 721, 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, "2030/12/17 14:59:59", 10046, 2, "アサヒ", 0.0, 24026, 5.1);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192301, "2020/07/31 12:00:00", 24, 821, 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, "2030/12/17 14:59:59", 10046, 1, "部員３", 0.0, 24027, 4.34);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (192501, "2020/07/31 12:00:00", 24, 521, 1, "いい勝負だったよ\nまたやろうね", 0.0, "2030/12/17 14:59:59", 10046, 1, "", 0.0, 24028, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 101, 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0, "2030/12/17 14:59:59", 10046, 1, "ミサト", 0.0, 24029, 5.62);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 102, 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0, "2030/12/17 14:59:59", 10046, 1, "ミサト", 0.0, 24030, 9.58);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 103, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0, "2030/12/17 14:59:59", 10046, 2, "ミサト", 0.0, 24031, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 104, 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0, "2030/12/17 14:59:59", 10046, 2, "ミサト", 0.0, 24032, 9.13);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113501, "2020/07/31 12:00:00", 24, 105, 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0, "2030/12/17 14:59:59", 10046, 1, "ミサト", 0.0, 24033, 8.27);
